import React from 'react';
import {
    FooterContainer,
    FooterWrap
} from './FooterElements';

const Footer = () => {
    return (
        <>
          <FooterContainer>
              <FooterWrap>
              <SocialMedia>
              <SocialMediaWrap>
                  <SocialLogo to='/'>Tanishq</SocialLogo>
              </SocialMediaWrap>
              </SocialMedia>
              </FooterWrap>
          </FooterContainer>  
        </>
    )
}

export default Footer
